import Logo from "./img/logo.png";
import "./header.scss";

const Header = () => {


    return(

        <header>

            <div>

                <img src={Logo}/ >

                <nav className="header-nav">
                    <li>mais</li>
                    <li>produtos</li>
                    <li>venda</li>
                    <li>contato</li>
                </nav>
            </div>


        </header>
    )

}

export default Header;
